pragma solidity ^0.4.24;

contract MarketAdmin {
  /* owner of the marketplace */
  address public marketOwner;
  address[] public admins;
  address[] public storeowners;
  mapping (address => bool) public approvedAdmins;
  mapping (address => bool) public approvedStoreOwners;


  /* Create a modifer that checks if the msg.sender is the owner of the contract */
  modifier onlyOwner (address _address) { require (msg.sender == _address); _;} 

  /* Create a modifer that checks if the msg.sender is an admin */
  modifier onlyAdmin (address _address) { require (approvedAdmins[_address]); _;}

  event adminAdded(address _admin);
  event adminRemoved(address _admin);
  event storeownerAdded(address _storeowner);

  constructor() public{
    marketOwner = msg.sender;
    approvedAdmins[msg.sender] = true;
    admins.push(msg.sender);
  }

  /* Contract owner can add other admins for the marketplace*/
  function addAdmin(address admin) onlyOwner(msg.sender) public {
    require(approvedAdmins[admin] == false);
    approvedAdmins[admin] = true; 
    admins.push(admin);
    emit adminAdded(admin);
  }

  /* Contract owner can remove other admins for the marketplace
  function removeAdmin(address admin) onlyOwner(msg.sender) public {
    require(approvedAdmins[admin] == true);
    require(admin != marketOwner); //can't remove the contract owner
    approvedAdmins[admin] = false; 
    emit adminRemoved(admin);
  }*/

  function addStoreOwner(address storeowner) onlyAdmin(msg.sender) public {
    require(approvedStoreOwners[storeowner] == false);
    approvedStoreOwners[storeowner] = true; 
    storeowners.push(storeowner);
    emit storeownerAdded(storeowner);
  }

  function isAdmin(address checkaddress) public view returns(bool) {
    return(approvedAdmins[checkaddress]);
  }

  function isStoreOwner(address checkaddress) public view returns(bool) {
    return(approvedStoreOwners[checkaddress]);
  }

  function getAdmins() public view returns(address[]) {
    return(admins);
  }

  function getStoreOwners() public view returns(address[]) {
    return(storeowners);
  }

}
